import Switchsvg from '../../assets/img/icon/Switchsvg.svg'

const Topcrypto = ({cryptoname, cryptoprich, cryptolavel, isHighlighted}) => {
  return (
    <>
        <li className={`list-item d-flex align-items-center gap-2 ${isHighlighted ? 'text-theme4' : 'text-theme3'}`}>{cryptoname} <span className="prich">{cryptoprich}</span> <span className="prich text-theme3 cryptolavel">{cryptolavel}</span></li>
    </>
  )
}

export default Topcrypto
